import React, { useEffect, useState } from 'react'
import { input } from '../features/collection'
import CollectionCatBar from './CollectionCatBar'
import { useDispatch } from 'react-redux' 
import Navbar from './Navbar'
import Catergory from './Catergory'
import BreadCrumb from './BreadCrumb'
import { useNavigate } from 'react-router-dom'



const Collection = () => {
  const [date, setDate] = useState('')
  const [line, setLine] = useState('')
  const [bringAmount, setBringAmount] = useState()
  const dispatch = useDispatch()
  const navigate = useNavigate()


  useEffect(() => {
    
  }, []);

  const selectLine = (e) => {
    setLine(e);
  }


  const handleSubmit = (e) => {
    e.preventDefault();
    dispatch(input({
      line:line,date:date.toString(),bringAmount : bringAmount
    }))
    navigate('collection/collection-details')
  }


  return (
    <>
    <Navbar />
    <Catergory />
    <BreadCrumb />
    <div className='container d-flex justify-content-center align-items-center'>
        <div className="row">
          <div className="col-md-12 d-flex flex-column justify-content-center align-items-center">
            <form action="" className='d-flex flex-column justify-content-center align-items-center mt-2' id='collection-form' onSubmit={handleSubmit}>
              <div className="">
                <label htmlFor="Date" className='form-label label my-3'>Date : </label>
                <input type="date" className='form-input col-input mx-5 my-3' onChange={(e) => setDate(e.target.value)} />
              </div>
              <div className="d-flex flex-row justify-content-center align-items-center">
                <label htmlFor="Line" className='form-label label my-3'>Line : </label>
                <select defaultValue="" className="form-select form-select-sm w-50 mx-5 my-3" id="select" aria-label=".form-select-sm example" onChange={(e) => selectLine(e.target.value)}>
                  <option value=""  >Open this select menu</option>
                  <option value="daily">Daily</option>
                  <option value="weekly">Weekly</option>
                  <option value="monthly">Monthly</option>
                </select>
              </div>
         
              <div className="d-flex flex-row justify-content-center align-items-center">
                <label htmlFor="bringing_amount" className='form-label my-3 label text-wrap' style={{ textAlign: "center" }}>Bringing Amount</label>
                <input type="number" className='form-input col-input w-50  my-3' id='bringAmtInput' onChange={(e) => setBringAmount(e.target.value)} />
              </div>
              <button type='submit' className='btn btn-outline-info'>Submit</button>
              <br />
            </form> <br /><br />
          </div>
        </div>
      
    </div>
    </>
  )
}

export default Collection
